INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (0.5, 1, 102711, 1, 0, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 10, 16612, 0, 11, 16612031);
