INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (0.5, 1, 101311, 1, 0, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 10, 16612, 0, 11, 16612036);
