INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (0.5, 1, 103011, 1, 0, "シュバババババ～♪\n忍法に不可能はありまセン！\nウキヨエを壁に描くのも\nお手の物デス！", 10, 19812, 0, 11, 19812029);
