INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (0.5, 1, 100811, 1, 0, "美を伝えるという点では同じだよ。\nボクだって歯磨きをするボクや\nお昼ご飯を食べるボクがいるけど、\n全て美しいボクには違いないでしょ？", 10, 19812, 0, 11, 19812039);
